import logo from "./logo.svg";
import "./App.css";

function App() {
	return (
		<div className="bg-[#19173D] h-screen w-full">
			<div className="h-full  flex justify-center items-center mx-4">
        <div className="bg-[#7B78AA] text-white min-w-full md:min-w-64  min-h-96 rounded-2xl">
          <p>Outstanding Balance : <span>3,150</span></p>
					<div className=" flex justify-center items-center  ">
						<div className="flex items-center gap-3">
							<p className="font-semibold text-lg">Available Balance :</p>
							<p>0</p>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
}

export default App;
